<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Emerald Demand Index</title>
<style>
  @import url('https://fonts.googleapis.com/css2?family=DM+Sans:wght@400;500;600;700&family=JetBrains+Mono:wght@400;500&display=swap');
  * { margin: 0; padding: 0; box-sizing: border-box; }
  body {
    font-family: 'DM Sans', sans-serif;
    background: #0a0f1a;
    color: #e0e4ec;
    min-height: 100vh;
    overflow-x: hidden;
  }
  .header {
    padding: 20px 28px 12px;
    display: flex; justify-content: space-between; align-items: flex-start;
    flex-wrap: wrap; gap: 12px;
  }
  .header h1 { font-size: 20px; font-weight: 700; color: #fff; letter-spacing: -0.5px; }
  .header .subtitle { font-size: 12px; color: #7a8299; margin-top: 3px; }
  .legend {
    display: flex; align-items: center; gap: 6px;
    font-size: 11px; color: #7a8299; font-family: 'JetBrains Mono', monospace;
  }
  .legend-bar {
    width: 160px; height: 10px; border-radius: 5px;
    background: linear-gradient(to right, #1a1f2e, #1b3a4b, #1a6b5a, #b8a038, #d4542e);
  }
  .controls {
    padding: 0 28px 8px;
    display: flex; gap: 12px; align-items: center; flex-wrap: wrap;
  }
  .control-group { display: flex; align-items: center; gap: 5px; }
  .control-group label { font-size: 11px; color: #7a8299; font-weight: 500; }
  select {
    font-family: 'DM Sans', sans-serif; background: #141929; color: #e0e4ec;
    border: 1px solid #2a3040; border-radius: 5px; padding: 5px 8px; font-size: 11px; cursor: pointer;
  }
  select:focus { outline: none; border-color: #4a7; }
  .filter-btn, .radius-btn {
    font-family: 'DM Sans', sans-serif; background: #141929; color: #7a8299;
    border: 1px solid #2a3040; border-radius: 5px; padding: 5px 10px;
    font-size: 11px; cursor: pointer; transition: all 0.15s;
  }
  .filter-btn:hover { border-color: #4a7; color: #e0e4ec; }
  .filter-btn.active { background: #1a3a2e; border-color: #4a7; color: #6ddbab; }
  .radius-btn:hover { border-color: #c67b3a; color: #e0e4ec; }
  .radius-btn.active { background: #2a2218; border-color: #c67b3a; color: #f0a050; }
  .stats-bar {
    padding: 6px 28px 4px;
    display: flex; gap: 20px; font-size: 11px; color: #7a8299; flex-wrap: wrap;
  }
  .stat-val { color: #e0e4ec; font-family: 'JetBrains Mono', monospace; font-weight: 600; }
  .map-container { position: relative; width: 100%; padding: 0 8px; }
  #map { width: 100%; height: auto; display: block; }
  .county { stroke: #0e1420; stroke-width: 0.2px; cursor: pointer; }
  .county:hover { stroke: #fff; stroke-width: 1.5px; filter: brightness(1.3); }
  .county.dimmed { opacity: 0.12; }
  .county.in-radius { stroke: #f0a050; stroke-width: 0.6px; }
  .state-border { fill: none; stroke: #2a3040; stroke-width: 0.7px; pointer-events: none; }
  .radius-circle {
    fill: rgba(240,160,80,0.05); stroke: #f0a050; stroke-width: 1.5px; stroke-dasharray: 6,4;
    pointer-events: none; opacity: 0;
  }
  .radius-circle.visible { opacity: 1; }
  .tooltip {
    position: fixed; pointer-events: none; background: #141929ee;
    border: 1px solid #2a3040; border-radius: 10px; padding: 14px 16px;
    font-size: 11px; line-height: 1.5; z-index: 1000;
    min-width: 250px; max-width: 320px;
    box-shadow: 0 8px 32px rgba(0,0,0,0.6); opacity: 0; transition: opacity 0.1s;
    backdrop-filter: blur(8px);
  }
  .tooltip.visible { opacity: 1; }
  .tt-name { font-size: 14px; font-weight: 700; color: #fff; margin-bottom: 4px; }
  .tt-score { font-family: 'JetBrains Mono', monospace; font-size: 20px; font-weight: 700; margin-bottom: 1px; }
  .tt-tier { font-size: 10px; color: #7a8299; margin-bottom: 8px; text-transform: uppercase; letter-spacing: 0.5px; }
  .tt-divider { height: 1px; background: #2a3040; margin: 7px 0; }
  .tt-row { display: flex; justify-content: space-between; padding: 1.5px 0; }
  .tt-label { color: #7a8299; font-size: 11px; }
  .tt-value { font-family: 'JetBrains Mono', monospace; color: #e0e4ec; font-weight: 500; font-size: 11px; }
  .tt-components { display: grid; grid-template-columns: 1fr 1fr; gap: 3px 14px; margin-top: 3px; }
  .tt-comp { display: flex; justify-content: space-between; align-items: center; gap: 6px; }
  .tt-bar-container { display: flex; align-items: center; gap: 4px; flex: 1; }
  .tt-bar-bg { flex: 1; height: 3px; background: #1a1f2e; border-radius: 2px; overflow: hidden; }
  .tt-bar-fill { height: 100%; border-radius: 2px; }
  .radius-panel {
    position: fixed; bottom: 20px; left: 50%; transform: translateX(-50%);
    background: #141929ee; border: 1px solid #c67b3a44; border-radius: 12px;
    padding: 14px 20px; font-size: 12px; z-index: 999;
    box-shadow: 0 8px 32px rgba(0,0,0,0.5); backdrop-filter: blur(8px);
    display: none; min-width: 360px;
  }
  .radius-panel.visible { display: flex; gap: 20px; align-items: center; flex-wrap: wrap; }
  .rp-title { font-size: 11px; color: #f0a050; text-transform: uppercase; letter-spacing: 0.5px; font-weight: 600; white-space: nowrap; }
  .rp-stats { display: flex; gap: 16px; flex-wrap: wrap; }
  .rp-stat { white-space: nowrap; }
  .rp-val { font-family: 'JetBrains Mono', monospace; color: #fff; font-weight: 700; font-size: 13px; }
  .rp-label { color: #7a8299; font-size: 10px; }
  #debugInfo { position: fixed; top: 4px; right: 8px; font-family: 'JetBrains Mono', monospace; font-size: 10px; color: #555; z-index: 9999; }
</style>
</head>
<body>
<div class="header">
  <div>
    <h1>Emerald Demand Index</h1>
    <div class="subtitle">County-level meter pickup service demand Â· 3,190 counties</div>
  </div>
  <div class="legend"><span>0</span><div class="legend-bar"></div><span>100</span></div>
</div>
<div class="controls">
  <div class="control-group">
    <label>Tier:</label>
    <button class="filter-btn active" data-tier="all">All</button>
    <button class="filter-btn" data-tier="5">5 (Top)</button>
    <button class="filter-btn" data-tier="4">4</button>
    <button class="filter-btn" data-tier="3">3</button>
    <button class="filter-btn" data-tier="2">2</button>
    <button class="filter-btn" data-tier="1">1 (Low)</button>
  </div>
  <div class="control-group">
    <label>Color by:</label>
    <select id="colorBy">
      <option value="score">Demand Index</option>
      <option value="ms">Market Size</option>
      <option value="ia">Infra Age</option>
      <option value="cs">Climate Stress</option>
      <option value="ec">Economic Capacity</option>
      <option value="oc">Consolidation</option>
      <option value="gp">Growth Potential</option>
    </select>
  </div>
  <div class="control-group">
    <label>Facility Diameter:</label>
    <button class="radius-btn active" data-radius="0">Off</button>
    <button class="radius-btn" data-radius="100">200 mi</button>
    <button class="radius-btn" data-radius="200">400 mi</button>
    <button class="radius-btn" data-radius="300">600 mi</button>
  </div>
</div>
<div class="stats-bar" id="statsBar"></div>
<div class="map-container"><svg id="map" viewBox="0 0 975 610"></svg></div>
<div class="tooltip" id="tooltip"></div>
<div class="radius-panel" id="radiusPanel"></div>
<div id="debugInfo"></div>

const tierLabels = {1:'Tier 1 â Low',2:'Tier 2 â Below Avg',3:'Tier 3 â Moderate',4:'Tier 4 â High',5:'Tier 5 â Top'};
const compLabels = {ms:'Market Size',ia:'Infra Age',cs:'Climate',ec:'Economic',oc:'Consolidation',gp:'Growth'};

function makeScale(key) {
  const vals = Object.values(CD).map(d => key==='score'?d[IDX.score]:d[IDX[key]]).filter(v=>v!=null);
  const lo=Math.min(...vals), hi=Math.max(...vals);
  const colors=['#1a1f2e','#1b3a4b','#1a6b5a','#b8a038','#d4542e'];
  return function(v) {
    if(v==null) return '#0e1118';
    const t=Math.max(0,Math.min(1,(v-lo)/(hi-lo||1)));
    const idx=Math.min(Math.floor(t*(colors.length-1)),colors.length-2);
    const f=t*(colors.length-1)-idx;
    return d3.interpolateRgb(colors[idx],colors[idx+1])(f);
  };
}

  }).join('');
  const sc=colorScale(dd[IDX.score]);
  tooltip.innerHTML='<div class="tt-name">'+dd[IDX.name]+'</div><div class="tt-score" style="color:'+sc+'">'+dd[IDX.score].toFixed(1)+'</div><div class="tt-tier">'+tierLabels[dd[IDX.tier]]+'</div><div class="tt-divider"></div><div class="tt-components">'+compBars+'</div><div class="tt-divider"></div><div class="tt-row"><span class="tt-label">Est. Meters</span><span class="tt-value">'+(dd[IDX.mt]?fmtK(dd[IDX.mt]):'â')+'</span></div><div class="tt-row"><span class="tt-label">Population</span><span class="tt-value">'+(dd[IDX.pop]?fmt(dd[IDX.pop]):'â')+'</span></div><div class="tt-row"><span class="tt-label">Median Income</span><span class="tt-value">'+(dd[IDX.inc]?'$'+fmt(dd[IDX.inc]):'â')+'</span></div><div class="tt-row"><span class="tt-label">Median Yr Built</span><span class="tt-value">'+(dd[IDX.yb]||'â')+'</span></div><div class="tt-row"><span class="tt-label">Utilities</span><span class="tt-value">'+(dd[IDX.nu]||'â')+'</span></div>';
  tooltip.classList.add('visible');
  const rect=tooltip.getBoundingClientRect();
  let x=e.clientX+14,y=e.clientY-8;
  if(x+rect.width>window.innerWidth-8) x=e.clientX-rect.width-14;
  if(y+rect.height>window.innerHeight-8) y=window.innerHeight-rect.height-8;
  if(y<8) y=8;
  tooltip.style.left=x+'px';tooltip.style.top=y+'px';
}

const svg=d3.select('#map');
const path=d3.geoPath();
const counties=topojson.feature(US,US.objects.counties);
const states=topojson.mesh(US,US.objects.states,(a,b)=>a!==b);

const countyPaths=svg.append('g')
  .selectAll('path')
  .data(counties.features)
  .join('path')
  .attr('class','county')
  .attr('d',path)
  .attr('fill',d=>{const cd=CD[d.id];return cd?colorScale(cd[IDX.score]):'#0e1118';})
  .on('mousemove',(e,d)=>{
    if(radiusMiles > 0) { showRadius(d.id, e); }
    else { showTooltip(e,d); }
  })
  .on('mouseleave',()=>{
    if(radiusMiles===0) tooltip.classList.remove('visible');
    else clearRadius();
  });

svg.append('path').datum(states).attr('class','state-border').attr('d',path);
const radiusCircle = svg.append('circle').attr('class','radius-circle').attr('r',0);

// County centroids in SVG/viewBox coordinates (from d3 path.centroid)
const centroids = {};
counties.features.forEach(f => {
  const c = path.centroid(f);
  if(c && isFinite(c[0]) && isFinite(c[1])) centroids[f.id] = c;
});

// Calibrate: LA (06037) to Chicago (17031) = 1745 miles
const ptLA = centroids['06037'];
const ptCHI = centroids['17031'];
let PX_PER_MILE;
if(ptLA && ptCHI) {
  const dx = ptLA[0]-ptCHI[0], dy = ptLA[1]-ptCHI[1];
  const distPx = Math.sqrt(dx*dx + dy*dy);
  PX_PER_MILE = distPx / 1745;
} else {
  PX_PER_MILE = 0.326;
}

// Debug display
document.getElementById('debugInfo').textContent =
  'px/mi=' + PX_PER_MILE.toFixed(4) +
  ' | 200mi=' + (200*PX_PER_MILE).toFixed(1) + 'px' +
  ' | LA=' + (ptLA?ptLA[0].toFixed(0)+','+ptLA[1].toFixed(0):'?') +
  ' | CHI=' + (ptCHI?ptCHI[0].toFixed(0)+','+ptCHI[1].toFixed(0):'?');

let lastHoveredFips = null;

function showRadius(fips, mouseEvent) {
  const center = centroids[fips];
  if(!center) return;

  lastHoveredFips = fips;
  const rPx = radiusMiles * PX_PER_MILE;

  // Position circle at the hovered county's centroid in SVG coords
  radiusCircle
    .attr('cx', center[0])
    .attr('cy', center[1])
    .attr('r', rPx)
    .classed('visible', true);

  // Find all counties within radius
  const rPx2 = rPx * rPx;
  const inRadius = [];
  for (const [id, [cx, cy]] of Object.entries(centroids)) {
    const dx = cx - center[0], dy = cy - center[1];
    if(dx*dx + dy*dy <= rPx2) inRadius.push(id);
  }

  const inSet = new Set(inRadius);
  countyPaths.classed('in-radius', d => inSet.has(d.id));

  // Aggregate stats
  const matched = inRadius.filter(f => CD[f]).map(f => CD[f]);
  const n = matched.length;
  if(n === 0) { radiusPanel.classList.remove('visible'); return; }

  const avgScore = (matched.reduce((s,d) => s+d[IDX.score], 0) / n).toFixed(1);
  const totalMeters = matched.reduce((s,d) => s+(d[IDX.mt]||0), 0);
  const totalPop = matched.reduce((s,d) => s+(d[IDX.pop]||0), 0);
  const avgMs = (matched.reduce((s,d) => s+d[IDX.ms], 0) / n).toFixed(0);
  const avgEc = (matched.reduce((s,d) => s+d[IDX.ec], 0) / n).toFixed(0);
  const avgOc = (matched.reduce((s,d) => s+d[IDX.oc], 0) / n).toFixed(0);
  const avgGp = (matched.reduce((s,d) => s+d[IDX.gp], 0) / n).toFixed(0);
  const t45 = matched.filter(d => d[IDX.tier]>=4).length;

  // Show center county name
  const centerName = CD[fips] ? CD[fips][IDX.name] : fips;

  radiusPanel.innerHTML =
    '<div class="rp-title">' + radiusMiles + ' mi from ' + centerName + '</div>' +
    '<div class="rp-stats">' +
    '<div class="rp-stat"><div class="rp-val">' + n + '</div><div class="rp-label">Counties</div></div>' +
    '<div class="rp-stat"><div class="rp-val">' + avgScore + '</div><div class="rp-label">Avg Score</div></div>' +
    '<div class="rp-stat"><div class="rp-val">' + fmtK(totalMeters) + '</div><div class="rp-label">Est. Meters</div></div>' +
    '<div class="rp-stat"><div class="rp-val">' + fmtK(totalPop) + '</div><div class="rp-label">Population</div></div>' +
    '<div class="rp-stat"><div class="rp-val">' + t45 + '</div><div class="rp-label">Tier 4-5</div></div>' +
    '<div class="rp-stat"><div class="rp-val">' + avgMs + '</div><div class="rp-label">Avg Market</div></div>' +
    '<div class="rp-stat"><div class="rp-val">' + avgEc + '</div><div class="rp-label">Avg Econ</div></div>' +
    '<div class="rp-stat"><div class="rp-val">' + avgOc + '</div><div class="rp-label">Avg Consol</div></div>' +
    '<div class="rp-stat"><div class="rp-val">' + avgGp + '</div><div class="rp-label">Avg Growth</div></div>' +
    '</div>';
  radiusPanel.classList.add('visible');

  // Also position tooltip for the hovered county
  tooltip.classList.remove('visible');
}

function clearRadius() {
  radiusCircle.classed('visible', false);
  countyPaths.classed('in-radius', false);
  radiusPanel.classList.remove('visible');
}

function recolor(){
  colorScale=makeScale(colorKey);
  countyPaths.attr('fill',d=>{
    const cd=CD[d.id]; if(!cd) return '#0e1118';
    return colorScale(colorKey==='score'?cd[IDX.score]:cd[IDX[colorKey]]);
  });
}

function filterTier(){
  countyPaths.classed('dimmed',d=>{
    if(activeTier==='all') return false;
    const cd=CD[d.id]; return !cd||cd[IDX.tier]!==parseInt(activeTier);
  });
  updateStats();
}

function updateStats(){
  const vis=Object.entries(CD).filter(([,d])=>activeTier==='all'||d[IDX.tier]===parseInt(activeTier));
  const n=vis.length;
  const avg=(vis.reduce((s,[,d])=>s+d[IDX.score],0)/n).toFixed(1);
  const meters=vis.reduce((s,[,d])=>s+(d[IDX.mt]||0),0);
  const pop=vis.reduce((s,[,d])=>s+(d[IDX.pop]||0),0);
  document.getElementById('statsBar').innerHTML=
    '<div>Counties: <span class="stat-val">'+fmt(n)+'</span></div>'+
    '<div>Avg Score: <span class="stat-val">'+avg+'</span></div>'+
    '<div>Total Est. Meters: <span class="stat-val">'+fmtK(meters)+'</span></div>'+
    '<div>Total Pop: <span class="stat-val">'+fmtK(pop)+'</span></div>';
}

document.getElementById('colorBy').addEventListener('change',e=>{colorKey=e.target.value;recolor();});
document.querySelectorAll('.filter-btn').forEach(btn=>{
  btn.addEventListener('click',()=>{
    document.querySelectorAll('.filter-btn').forEach(b=>b.classList.remove('active'));
    btn.classList.add('active'); activeTier=btn.dataset.tier; filterTier();
  });
});
document.querySelectorAll('.radius-btn').forEach(btn=>{
  btn.addEventListener('click',()=>{
    document.querySelectorAll('.radius-btn').forEach(b=>b.classList.remove('active'));
    btn.classList.add('active'); radiusMiles=parseInt(btn.dataset.radius);
    if(radiusMiles===0){ clearRadius(); document.getElementById('map').style.cursor='default'; }
    else { document.getElementById('map').style.cursor='crosshair'; }
  });
});

updateStats();
</script>
</body>
</html>
